import React from 'react';

const Rank = () => {
    return (
        <div>
            <div className="white f3">
                {'Bobo, Your current rank is ...'}
            </div>
            <div className="white f1">
                {'#3'}
            </div>
        </div>
    );
}

export default Rank;
